    let arr = ['Главная', 'Водоснабжение', 'Для абонентов', 'Раскрытие информации', 'Контакты']
    return (
        <div>
            <div className={'logo'}>

            </div>
            <div>
                <h2>Форма обратной связи</h2>

                {arr.map((item)=>{
                    <DropItem title={item}/>
                })}

            </div>
        </div>
    );
};

export default LeftBlock;
